#define VK_RETURN 80

static pthread_once_t once = PTHREAD_ONCE_INIT;
static pthread_mutex_t lock = PTHREAD_MUTEX_INITIALIZER;
EnigmaKey *break_enigma(char* ctext);
float entropy_score(char *text);
char ctext[4096];
